import { Component, OnInit, ViewChild } from '@angular/core';
import { NearbyPostService } from '../../services/nearby-post.service';
import { firstValueFrom } from 'rxjs';
import { MapInfoWindow } from '@angular/google-maps';
import { MiniKit } from '@worldcoin/minikit-js';

@Component({
  selector: 'app-world-map',
  standalone: false,
  templateUrl: './world-map.component.html',
  styleUrl: './world-map.component.css'
})
export class WorldMapComponent implements OnInit {
  @ViewChild(MapInfoWindow) infoWindow!: MapInfoWindow;
  center: google.maps.LatLngLiteral = { lat: 0, lng: 0 };
  wallet = ""
  userMarker: any = null;
  objSelected: any = {}
  showBuy: boolean = false
  locations: {
    position: { lat: number, lng: number },
    title: string,
    infoText: string,
    photoUrl: string,
    infoOpen: boolean
  }[] = [{
    position: { lat: 40.4168, lng: -3.7038 },
    title: 'Madrid Center',
    infoText: 'Main hub in Madrid.',
    photoUrl: 'assets/madrid.jpg',
    infoOpen: false
  },
  {
    position: { lat: 40.4200, lng: -3.7050 },
    title: 'Gran VÃ­a Spot',
    infoText: 'Popular area with great visibility.',
    photoUrl: 'assets/granvia.jpg',
    infoOpen: false
  },
  {
    position: { lat: 40.4120, lng: -3.7070 },
    title: 'Atocha Location',
    infoText: 'Next to train station.',
    photoUrl: 'assets/atocha.jpg',
    infoOpen: false
  }]

  constructor(private servicePosts: NearbyPostService) {

  }
  text: string = ""
  ngOnInit() {
    this.getUserLocation();
    this.wallet = JSON.stringify(MiniKit.user.walletAddress)
  }
  anim = google.maps.Animation.DROP
  markers = [
    {
      position: { lat: 37.7749, lng: -122.4194 },
      label: 'A',
      title: 'Marker A',
      options: { animation: google.maps.Animation.DROP }
    },
    {
      position: { lat: 37.7849, lng: -122.4094 },
      label: 'B',
      title: 'Marker B',
      options: { animation: google.maps.Animation.DROP }
    }
  ];
  markerOptions: google.maps.MarkerOptions = { draggable: false };

  getUserLocation() {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          this.center = {
            lat: position.coords.latitude,
            lng: position.coords.longitude
          };


          this.userMarker = {
            position: this.center,
            label: 'U',
            title: 'Your Location',
            options: { animation: google.maps.Animation.DROP }
          };
          this.getPost(position.coords.latitude, position.coords.longitude).then(res => {
            this.text = JSON.stringify(res)
            this.locations = (res as []).map((obj: any) => {
              // console.log(obj)
              let photoUrl: string = 'data:image/jpeg;base64,'

              return {
                position: { lat: obj.georeference.coordinates[0], lng: obj.georeference.coordinates[1] },
                title: obj.titulo,
                infoText: obj.categoria,
                photoUrl: photoUrl,
                infoOpen: false
              }
            })
            this.locations.forEach(a => { console.log(a) })
            let aux = []
            aux.push(this.locations[0])
            this.locations = aux
          }).catch((error) => {
            this.text = JSON.stringify(error)
          })


        },
        (error) => {
          console.error('Geolocation error:', error);
        }
      );
    } else {
      console.error('Geolocation not supported');
    }
  }
  getPost(lat: number, lng: number) {
    const querry: string = "lat=" + lat.toString() + "&lon=" + lng.toString()
    return firstValueFrom(this.servicePosts.getPosts(querry));

  }
  toggleInfo(index: number) {
    console.log(index)

    this.locations.forEach((_, i) => {

      this.locations[i].infoOpen = i === index ? !this.locations[i].infoOpen : false;
      if (i === index) {
        this.objSelected = this.locations[i]
      }
    });
  }

  openBuy() {
    this.showBuy = true;
  }
  close() {
    this.objSelected = {}
  }
  closeBuy() {
    this.showBuy = false
  }
}

